import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
  import Home from './Home';

class RounterURL extends Component {
    render() {
        return (
            <Router>
                <div>
                    <Route exact path="/" component = {Home} />

                </div>
            </Router>
        );
    }
}

export default RounterURL;
